// src/components/Home.jsx
import React from "react";
import "./Home.css";
import logo from "../assets/logo.png"; // Import the stylesheet

const Home = () => {
	return (
		<div className="home">
			<header className="home-banner">
				<img src={logo} alt="Logo" className="home-logo" />
				<h1 className="home-title">Welcome to Nature's Plate</h1>
				<p className="home-tagline">Savor the freshness of earthy flavors.</p>
				<button className="cta-button">Explore Our Menu</button>
			</header>
		</div>
	);
};

export default Home;
